  list.forEach(element => {
   let card = document.createElement("div");
   card.classList.add("card",element.category,"hide");

   let  img_container = document.createElement("div");
    img_container.classList.add("image-container");

    let img = document.createElement("img");
    img.setAttribute("src",element.img);
    img_container.appendChild(img);

    card.appendChild(img_container);

    let container = document.createElement("div");
    container.classList.add("container"); 
    
    let name = document.createElement("h5");
    name.classList.add("product-name");
    name.innerText = element.name.toUpperCase();
  container.appendChild(name);

  let price = document.createElement("h6");
  price.innerText = "$" + element.price;
  container.appendChild(price);
  card.appendChild(container)
  document.querySelector(".grid").appendChild(card);

  });


  function filterProduct(value){
    // for btns
 const btns = document.querySelectorAll(".button-value")
   btns.forEach(element => {
    
    if(value.toUpperCase() == element.innerText.toUpperCase()){
      element.classList.add("active")
    }
    else {
     element.classList.remove("active")
    }
   });

   allCards = document.querySelectorAll(".card")
   allCards.forEach(el =>{
   if(value.toUpperCase() == 'ALL'){
   
     el.classList.remove("hide");
   }
   else if(el.classList.contains(value)){ // to display item based on category
   
     el.classList.remove("hide");
   }
   else {
     el.classList.add("hide");
   }
   
   })

  }
  const input = document.querySelector("#search-input");
  const search = document.querySelector("#search");
  let cards = document.querySelectorAll(".card");
  
  search.addEventListener("click",()=>{
     cards.forEach((el)=>{
       if(el.textContent.includes(input.value.toUpperCase()))
    {
      el.classList.remove("hide")
  
    }
       else {
        el.classList.add("hide")
  
       }
     })
     
  })
  //for initial load instance
  window.onload = () => {
    filterProduct("all");
  };